scroll_y = 0

local saveData = {}
local saveEntities_ = {}
player = {
    x = 138,
    y = 115,
    speedX = .05,
    vx = 0,
    vy = 0,
    road_vy = -0.15,
    road_pos = 0,
    distance = 0
}

settings = {
    bb = false,
    high_score = pmem(2),
    tutorial = true,
    music = true,
    sound = true
}

function overlap(x_min1, x_max1, x_min2, x_max2)
    return x_max1 >= x_min2 and x_max2 >= x_min1
end

Entity = {
    x = 0,
    y = 0,
    ox = 0,
    oy = 0,
    w = 8,
    h = 8,
    sprh = 8,
    alive = true,
    active = true,
    stage = nil
}

function Entity:new(o)
    o = o or {}
    return setmetatable(o, {
        __index = self
    })
end

function Entity:overlap(e)
    local e1_x = self.x + self.ox
    local e1_y = self.y + self.oy
    local e2_x = e.x + e.ox
    local e2_y = e.y + e.oy
    return overlap(e1_x, e1_x + self.w, e2_x, e2_x + e.w) and overlap(e1_y, e1_y + self.h, e2_y, e2_y + e.h)
end

function Entity:draw()
end
function Entity:update(dt)
end

Car = Entity:new{
    type = "enemy",
    pos = 0,
    ox = 2,
    oy = 2,
    w = 14,
    h = 13,
    sprh = 24,
    spr = 5,
    direction = 0
}

function Car:draw()
    spr(self.spr, self.x, self.y, 0, 1, self.direction, 0, 2, 2)
    --rectb(self.x + self.ox, self.y + self.oy, self.w, self.h, 12)
end

function Car:update(dt)
    self.y = self.y - (self.stage.road_vy * dt) / 2
    self.pos = self.stage.road_pos
end

Player = Entity:new{
    type = "player",
    x = 138,
    y = 115,
    vx = 0,
    vy = 0,
    ox = 1,
    oy = 2,
    w = 13,
    h = 13,
    speedX = .05,
    road_vy = -0.15,
    road_pos = 0,
    distance = 0
}

function Player:draw()
    spr(0, self.x, self.y, 0, 1, 0, 0, 2, 2)
    --rectb(self.x + self.ox, self.y + self.oy, self.w, self.h, 12)
end

function Player:update(dt)
    if btn(2) then -- left
        if self.vx >= -1 then
            self.vx = self.vx - self.speedX
        end
    elseif btn(3) then -- right
        if self.vx <= 1 then
            self.vx = self.vx + self.speedX
        end
    else -- stop
        if self.vx > 0 then
            self.vx = self.vx - .05
            if self.vx < 0 then
                self.vx = 0
            end
        elseif self.vx < 0 then
            self.vx = self.vx + .05
            if self.vx > 0 then
                self.vx = 0
            end
        end
    end

    self.x = self.x + self.vx
    self:cartsLimits()
end

Stage = {}

function Stage:new(o)
    o = o or {}
    setmetatable(o, {
        __index = self
    })
    return o
end

function Stage:init()
end
function Stage:update(dt)
end
function Stage:quit()
end

function Positioner(total, initial)
    initial = initial or 1
    local pos = initial
    return {
        add = function()
            pos = pos + 1
        end,
        sub = function()
            pos = pos - 1
        end,
        pos = function()
            return ((pos - 1) % total) + 1
        end
    }
end

function cartMoves()

    if btn(0) then -- up
        -- if player.vy >= -3 then
        --    player.vy = player.vy - player.speedY
        -- end
    elseif btn(1) then -- down
        -- if player.vy <= 1 then
        --    player.vy = player.vy + player.speedY
        -- end
    else -- stop
        if player.vy > 0 then
            player.vy = player.vy - .05
            if player.vy < 0 then
                player.vy = 0
            end
        elseif player.vy < 0 then
            player.vy = player.vy + .05
            if player.vy > 0 then
                player.vy = 0
            end
        end
    end

    player.y = player.y + player.vy

    if btn(2) then -- left
        if player.vx >= -1 then
            player.vx = player.vx - player.speedX
        end
    elseif btn(3) then -- right
        if player.vx <= 1 then
            player.vx = player.vx + player.speedX
        end
    else -- stop
        if player.vx > 0 then
            player.vx = player.vx - .05
            if player.vx < 0 then
                player.vx = 0
            end
        elseif player.vx < 0 then
            player.vx = player.vx + .05
            if player.vx > 0 then
                player.vx = 0
            end
        end
    end

    player.x = player.x + player.vx
end

function Player:cartsLimits()
    if self.y < 0 then
        self.y = 0
    end
    if self.y > 120 then
        self.y = 120
    end
    if self.x < 31 then
        self.x = 31
    end
    if self.x > 194 then
        self.x = 194
    end
end

function StageManager()

    local stages = {}
    local actual_stage = {
        instance = Stage:new()
    }

    return {
        add = function(name, stage)
            stages[name] = {
                name = name,
                proto = stage,
                instance = nil
            }
        end,
        switch = function(name, keep_instance)
            keep_instance = keep_instance or false
            local new_stage = stages[name]

            if new_stage == nil then
                return
            end
            if actual_stage.name == name then
                return
            end

            actual_stage.instance:quit()
            if not keep_instance then
                actual_stage.instance = nil
            end

            if new_stage.instance == nil then
                new_stage.instance = new_stage.proto:new()
                new_stage.instance:init()
            end

            actual_stage = new_stage
            if name == "menu" then
                music(1)
            elseif name == "game" then
                music(0)
            elseif name == "pause" then
                music(1)
            end
        end,
        update = function(dt)
            actual_stage.instance:update(dt)
        end
    }
end

Menu = Stage:new{
    p = nil
}

function Menu:init()
    self.p = Positioner(2)
end

function Menu:update(dt)
    cls(0)
    map(210, 119, 30, 17)
    local y = 64
    print("Start", 90, y)
    print("Settings", 90, y + 10)
    spr(98, 80, (self.p.pos() - 1) * 10 + y - 2)

    if btnp(0) then
        self.p.sub()
    elseif btnp(1) then
        self.p.add()
    elseif btnp(4) or btnp(5) then
        if self.p.pos() == 1 then
            sm.switch("game")
        elseif self.p.pos() == 2 then
            sm.switch("settings")
        end
    end
end

Game = Stage:new{
    entities = nil,
    entity_count = 0,
    distance = 0,
    player = nil,
    road_vy = .15,
    road_pos = 0,
    last_obstacle = 0,
    next_obstacle = 100,
    state = "game",
    car = false,
    poli = false,
    tanke = false,
    explosion = false
}

function Game:init()
    self.player = Player:new{
        x = player.x,
        y = player.y,
        vx = player.vx,
        vy = player.vy,
        speedX = player.speedX
    }
    self.entities = saveEntities_
    self.entity_count = 0
    self:add_entity(self.player)
    self.road_vy = player.road_vy
    self.road_pos = player.road_pos
    self.distance = player.distance
end

function Game:add_entity(entity)
    table.insert(self.entities, entity)
    self.entity_count = self.entity_count + 1
end

function Game:update(dt)
    cls()
    local sound_playing = false
    local sound_timer = 0
    if sm.state == "pause" then
        self:drawPauseMenu()
        return
    end

    self:draw_road()
    self:draw_entities()

    if self.state == "game over" then
        print("GAME OVER", 64, 73, 0, false, 2)
    else
        self:update_entities(dt)
    end

    self:update_road(dt)
    -- map(0, scroll_y // 8, 30, 17, 0, (scroll_y % 8) - 8)
    -- map(0, (scroll_y // 8) + 1, 30, 17, 0, (scroll_y % 8) + 8)
    for i, e in pairs(self.entities) do
        if self.player:overlap(e) then
            if e.type == "enemy" then
                self.state = "game over"
                if self.explosion == false or sound_playing then
                    sfx(8, "F-3", -1, 2, 15, 8)
                    sound_playing = true 
                    sound_timer = 120
                    self.explosion = true
                end
                if sound_playing then
                    sound_timer = sound_timer - 1
                    if sound_timer <= 0 then
                        sound_playing = false
                    end
                end
                spr(33, self.player.x, self.player.y, 0, 1, -1, 0, 2, 2)
                spr(33, e.x, e.y, 0, 1, 0, 0, 2, 2)
            end
        end
    end

    if self.state == "game over" then
        if btn(4) or btn(5) then
            saveEntities_ = {}
            sm.switch("menu")
        end
    end
end

function Game:draw_entities()
    table.sort(self.entities, function(e1, e2)
        return (e1.y + e1.sprh) < (e2.y + e2.sprh)
    end)
    for i = 1, #self.entities do
        local e = self.entities[i]
        e:draw()
        if settings.bb then
            rectb(e.x + e.ox, e.y + e.oy, e.w, e.h, 0)
        end
    end
end

function Game:update_entities(dt)
    local entities_ = {}
    local entity_count_ = 0
    for i = 1, #self.entities do
        local e = self.entities[i]
        e:update(dt)
        if e.alive and e.y < 220 then
            table.insert(entities_, e)
            entity_count_ = entity_count_ + 1
        else
            if e.name == 'car' then
                self.car = false
            end
        end
    end
    self.entity_count = entity_count_
    self.entities = entities_
end

function Game:draw_road()
    local pos = math.floor(self.road_pos)
    local tmp = pos % 240

    if tmp > 119 then
        map(0, 0, 30, 17, 0, -(tmp - 120))
        map(30, 0, 30, 17, 0, -(tmp - 240))
        map(0, 0, 30, 17, 0, -(tmp - 360))
    else
        map(30, 0, 30, 17, 0, -tmp)
        map(0, 0, 30, 17, 0, -(tmp - 120))
        map(30, 0, 30, 17, 0, -(tmp - 240))
    end
    print("actual", 8, 18, 3)
    print(string.format("%06.f m", self.distance), 8, 26, 9, true)
    print("high", 8, 2, 3)
    print(string.format("%06.f m", settings.high_score), 8, 10, 9, true)

    if key(50) then
        self:pauseGame()
    end
end

function Game:update_road(dt)

    if self.state == "game" then
        self.road_vy = self.road_vy - 0.000001 * dt
    end

    if self.state ~= "game over" then
        self.road_pos = self.road_pos + self.road_vy * dt
    end

    if self.state == "game" then

        self.distance = -0.1406 * self.road_pos

        if self.distance > settings.high_score then
            settings.high_score = self.distance
        end

        if -self.road_pos > self.last_obstacle then
            local p = {42, 64, 86}
            local i = math.random(1, #p)

            if self.distance > 20 and self.car == false then
                table.insert(self.entities, Car:new{
                    pos = -1 * self.road_pos,
                    x = p[i] + math.random(1, 5) - 2,
                    y = 0,
                    stage = self,
                    spr = 5,
                    name = "car",
                    direction = -1
                })
                self.entity_count = self.entity_count + 1
                self.car = true
            end

            self.last_obstacle = -1 * self.road_pos + self.next_obstacle
        end
    end
end

function Game:pauseGame()
    saveData = {
        player_x = self.player.x,
        player_y = self.player.y,
        player_vx = self.player.vx,
        player_vy = self.player.vy,
        road_vy = self.road_vy,
        road_pos = self.road_pos,
        distance = self.distance
    }
    saveEntities_ = self.entities
    sm.switch("pause")
end

Pause = Stage:new{
    p = nil
}

function Pause:init()
    self.p = Positioner(3)
end

function Pause:update(dt)
    cls(0)
    map(180, 119, 30, 17)
    local y = 54
    print("Continue", 90, y)
    print("Restart", 90, y + 10)
    print("Quit", 90, y + 20)
    spr(98, 80, (self.p.pos() - 1) * 10 + y - 2)

    if btnp(0) then
        self.p.sub()
    elseif btnp(1) then
        self.p.add()
    elseif btnp(4) or btnp(5) then
        if self.p.pos() == 1 then
            self:resumeGame()
        elseif self.p.pos() == 2 then
            self:restartGame()
        elseif self.p.pos() == 3 then
            self:quitGame()
        end
    end
end

function Pause:resumeGame()
    if saveData then
        player.x = saveData.player_x
        player.y = saveData.player_y
        player.vx = saveData.player_vx
        player.vy = saveData.player_vy
        player.road_vy = saveData.road_vy
        player.road_pos = saveData.road_pos
        player.distance = saveData.distance
    end
    sm.switch("game")
end

function Pause:restartGame()
    if saveData then
        player.x = 138
        player.y = 115
        player.vx = 0
        player.vy = 0
        player.road_vy = -0.15
        player.road_pos = 0
        player.distance = 0
    end
    saveEntities_ = {}
    sm.switch("game")
end

function Pause:quitGame()
    if saveData then
        player.x = 138
        player.y = 115
        player.vx = 0
        player.vy = 0
        player.road_vy = -0.15
        player.road_pos = 0
        player.distance = 0
    end
    sm.switch("menu")
end

sm = StageManager()
sm.add("menu", Menu)
sm.add("game", Game)
sm.add("pause", Pause)
sm.switch("menu")

last_t = time()
function TIC()
    local actual_t = time()
    local dt = actual_t - last_t

    cls()

    scroll_y = scroll_y + 0.6
    if dt < 500 then
        sm.update(dt)
    end

    last_t = actual_t
end

